schemaDefinition: "create or replace view NOW_ON_NOW_KNOWLEDGE_SESSIONS(\n\tSESSIONCATEGORY,\n\
  \tEVENT_LOCATION,\n\tSESSIONTITLE,\n\tSESSION_ATTENDEES,\n\tHOT_LEADS,\n\tOVERALL_RATING,\n\
  \tAVG_CONTENT,\n\tAVG_SPEAKER,\n\tPIPELINE_INFLUENCED,\n\tOPEN_ACV,\n\tPIPELINE_CREATED\n\
  ) as (\nselect\nSESSIONCATEGORY\n,EVENT_LOCATION\n,SESSIONTITLE\n,SESSION_ATTENDEES\n\
  ,HOT_LEADS\n,OVERALL_RATING\n,AVG_CONTENT\n,AVG_SPEAKER\n,round((REGEXP_REPLACE(ATTENDED_OPEN_PIPELINE,\
  \ 'random', 'random')),'random') as PIPELINE_INFLUENCED\n,round((REGEXP_REPLACE(OPEN_ACV,\
  \ 'random', 'random')),'random') as OPEN_ACV\n,round((REGEXP_REPLACE(CREATED_PIPELINE,\
  \ 'random', 'random')),'random') as PIPELINE_CREATED\nFROM RDS.FLATFILESOURCE.NOW_ON_NOW_KNOWLEDGE_SESSIONS);"
